import React from "react";
import { Box } from "@mui/material";
import RuneRow from "./RuneRow";
import { Rune } from "../../../types/Rune";

interface PrimaryMasteryTreeProps {
  selectedRuneIds: number[];
  rows: Rune[][];
}
const PrimaryMasteryTree: React.FC<PrimaryMasteryTreeProps> = ({
  selectedRuneIds,
  rows,
}) => {
  return (
    <Box
      sx={{
        borderRadius: "8px",
        backgroundColor: "#091428",
        //borderColor: "#F0E6D2",
        borderWidth: "0.05rem",
        borderStyle: "solid",
        p: 1,
        maxWidth: "100%",
      }}
    >
      <RuneRow
        selectedRuneId={selectedRuneIds[0]}
        row={rows[0]}
        isKeystone={true}
      />
      <RuneRow
        selectedRuneId={selectedRuneIds[1]}
        row={rows[1]}
        isKeystone={false}
      />
      <RuneRow
        selectedRuneId={selectedRuneIds[2]}
        row={rows[2]}
        isKeystone={false}
      />
      <RuneRow
        selectedRuneId={selectedRuneIds[3]}
        row={rows[3]}
        isKeystone={false}
      />
    </Box>
  );
};
/*
<Typography variant="subtitle1" sx={{ mb: 2, color: "#F0E6D2" }}>
        {"Primary"}
      </Typography>
      */
export default PrimaryMasteryTree;
